DROP TABLE complainttype;

CREATE TABLE `complainttype` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) NOT NULL,
  `groupid` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `groupid` (`groupid`),
  CONSTRAINT `complainttype_ibfk_2` FOREIGN KEY (`groupid`) REFERENCES `group` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE department;

CREATE TABLE `department` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `divisionid` bigint(20) NOT NULL,
  `name` varchar(20) NOT NULL,
  `extension` varchar(50) NOT NULL,
  `biomedical_department` tinyint(4) NOT NULL,
  `1` int(11) NOT NULL,
  `2` int(11) NOT NULL,
  `3` int(11) NOT NULL,
  `4` bigint(20) DEFAULT NULL,
  `5` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `divisionid` (`divisionid`),
  CONSTRAINT `department_ibfk_2` FOREIGN KEY (`divisionid`) REFERENCES `division` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=125 DEFAULT CHARSET=latin1;




DROP TABLE division;

CREATE TABLE `division` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;




DROP TABLE group;

;




DROP TABLE holdcategory;

CREATE TABLE `holdcategory` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;




DROP TABLE item;

CREATE TABLE `item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




DROP TABLE location;

CREATE TABLE `location` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `departmentid` bigint(20) NOT NULL,
  `name` varchar(20) NOT NULL,
  `groupid` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `divisionid` (`departmentid`),
  KEY `groupid` (`groupid`),
  CONSTRAINT `location_ibfk_3` FOREIGN KEY (`departmentid`) REFERENCES `department` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `location_ibfk_4` FOREIGN KEY (`groupid`) REFERENCES `group` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=366 DEFAULT CHARSET=latin1;




DROP TABLE partdetails;

CREATE TABLE `partdetails` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `complaintid` bigint(20) NOT NULL,
  `partname` varchar(20) NOT NULL,
  `quantity` bigint(20) NOT NULL,
  `procuredfrom` bigint(20) NOT NULL,
  `amount` int(11) NOT NULL,
  `bycash` tinyint(1) NOT NULL,
  `addedby` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `complaintid` (`complaintid`),
  KEY `procuredfrom` (`procuredfrom`),
  KEY `addedby` (`addedby`),
  CONSTRAINT `partdetails_ibfk_4` FOREIGN KEY (`complaintid`) REFERENCES `complaint` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `partdetails_ibfk_5` FOREIGN KEY (`procuredfrom`) REFERENCES `store` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `partdetails_ibfk_6` FOREIGN KEY (`addedby`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1979 DEFAULT CHARSET=latin1;




DROP TABLE priority;

CREATE TABLE `priority` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE remarks;

CREATE TABLE `remarks` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `complaintid` bigint(20) NOT NULL,
  `skill` bigint(20) NOT NULL,
  `standard` bigint(20) NOT NULL,
  `courtesy` bigint(20) NOT NULL,
  `timeliness` bigint(20) NOT NULL,
  `addedby` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `complaintid` (`complaintid`),
  KEY `skill` (`skill`),
  KEY `standard` (`standard`),
  KEY `courtesy` (`courtesy`),
  KEY `timeliness` (`timeliness`),
  KEY `addedby` (`addedby`),
  CONSTRAINT `remarks_ibfk_10` FOREIGN KEY (`courtesy`) REFERENCES `remarkstype` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `remarks_ibfk_11` FOREIGN KEY (`timeliness`) REFERENCES `remarkstype` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `remarks_ibfk_12` FOREIGN KEY (`addedby`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `remarks_ibfk_7` FOREIGN KEY (`complaintid`) REFERENCES `complaint` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `remarks_ibfk_8` FOREIGN KEY (`skill`) REFERENCES `remarkstype` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `remarks_ibfk_9` FOREIGN KEY (`standard`) REFERENCES `remarkstype` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1446 DEFAULT CHARSET=latin1;




DROP TABLE remarkstype;

CREATE TABLE `remarkstype` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;




DROP TABLE softwares;

CREATE TABLE `softwares` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(25) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;




DROP TABLE source;

CREATE TABLE `source` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




DROP TABLE status;

CREATE TABLE `status` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




DROP TABLE store;

CREATE TABLE `store` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE subgroup;

CREATE TABLE `subgroup` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `groupid` bigint(20) NOT NULL,
  `name` varchar(20) NOT NULL,
  `users` text NOT NULL,
  `complainttype` varchar(250) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `groupid` (`groupid`),
  CONSTRAINT `subgroup_ibfk_2` FOREIGN KEY (`groupid`) REFERENCES `group` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;




DROP TABLE user;

CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(20) NOT NULL,
  `lastname` varchar(20) NOT NULL,
  `phonenumber` bigint(10) NOT NULL,
  `username` varchar(20) NOT NULL,
  `password` varchar(20) NOT NULL,
  `userroleid` bigint(20) NOT NULL,
  `departmentid` bigint(20) NOT NULL,
  `groupid` bigint(20) DEFAULT NULL,
  `deptadmin` tinyint(4) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `userroleid` (`userroleid`),
  KEY `departmentid` (`departmentid`),
  KEY `groupid` (`groupid`),
  CONSTRAINT `user_ibfk_4` FOREIGN KEY (`userroleid`) REFERENCES `userrole` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `user_ibfk_5` FOREIGN KEY (`departmentid`) REFERENCES `department` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=411 DEFAULT CHARSET=latin1;




DROP TABLE userrole;

CREATE TABLE `userrole` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `role` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




DROP TABLE zone;

CREATE TABLE `zone` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




